init_prisma();
var trackLogin = async (userId, email, ipAddress, userAgent, success) => {
  try {
    await prisma.activity_logs.create({
      data: {
        id: nanoid(),
        userId,
        action: success ? "LOGIN" : "LOGIN_FAILED",
        entityType: "USER",
        entityId: userId,
        description: success ? `User ${email} logged in successfully` : `Failed login attempt for ${email}`,
        ipAddress,
        userAgent,
        metadata: JSON.stringify({ success, timestamp: new Date }),
        createdAt: new Date
      }
    });
    if (success) {
      const user = await prisma.users.findUnique({
        where: { id: userId },
        select: { firstName: true, lastName: true, role: true }
      });
      if (user) {
        await createSystemNotification({
          type: "USER_LOGIN",
          title: "User Login",
          message: `${user.firstName} ${user.lastName} (${user.role}) logged in`,
          actionType: "LOGIN",
          actionBy: userId,
          entityType: "USER",
          entityId: userId,
          metadata: { ipAddress, timestamp: new Date }
        });
      }
    }
  } catch (error) {
    console.error("Login tracking error:", error);
  }
};
async function createSystemNotification(data) {
  try {
    const adminUsers = await prisma.users.findMany({
      where: {
        role: { in: ["ADMIN", "SUPER_ADMIN", "ACCOUNTING"] },
        isActive: true,
        id: data.actionBy ? { not: data.actionBy } : undefined
      },
      select: { id: true }
    });
    if (adminUsers.length === 0)
      return;
    const notifications = adminUsers.map((admin) => ({
      id: nanoid(),
      userId: admin.id,
      type: data.type,
      title: data.title,
      message: data.message,
      actionType: data.actionType,
      actionBy: data.actionBy,
      entityType: data.entityType,
      entityId: data.entityId,
      metadata: JSON.stringify(data.metadata || {}),
      isRead: false,
      createdAt: new Date
    }));
    await prisma.notifications.createMany({
      data: notifications
    });
  } catch (error) {
    console.error("Error creating system notification:", error);
  }
}

