async function getUserAssignedCustomerIds(userId) {
  try {
    const assignments = await prisma.customer_assignments.findMany({
      where: {
        userId,
        isActive: true
      },
      select: {
        customerId: true
      }
    });
    return assignments.map((a) => a.customerId);
  } catch (error) {
    console.error("Error fetching user customer assignments:", error);
    return [];
  }
}
var applyBookingFilter = async (c, next) => {
  const user = c.get("user");
  if (!user) {
    return c.json({ error: "Unauthorized" }, 401);
  }
  if (user.role === "ADMIN" || user.role === "SUPER_ADMIN" || user.role === "MANAGER" || user.role === "FINANCIAL_CONTROLLER") {
    c.set("bookingFilter", null);
    await next();
    return;
  }
  if (user.role === "ACCOUNTANT") {
    c.set("bookingFilter", {
      status: "APPROVED"
    });
    await next();
    return;
  }
  const customerIds = await getUserAssignedCustomerIds(user.id);
  if (customerIds.length === 0) {
    c.set("bookingFilter", {
      id: "none"
    });
    await next();
    return;
  }
  c.set("bookingFilter", {
    customerId: { in: customerIds }
  });
  await next();
};
var canAccessBooking = async (c, next) => {
  const user = c.get("user");
  const bookingId = c.req.param("id");
  if (!user) {
    return c.json({ error: "Unauthorized" }, 401);
  }
  if (user.role === "ADMIN" || user.role === "SUPER_ADMIN" || user.role === "MANAGER" || user.role === "FINANCIAL_CONTROLLER") {
    await next();
    return;
  }
  const booking = await prisma.bookings.findUnique({
    where: { id: bookingId },
    select: { customerId: true, status: true }
  });
  if (!booking) {
    return c.json({ error: "Booking not found" }, 404);
  }
  if (user.role === "ACCOUNTANT") {
    if (booking.status !== "APPROVED") {
      return c.json({ error: "Access denied" }, 403);
    }
    await next();
    return;
  }
  const customerIds = await getUserAssignedCustomerIds(user.id);
  if (!customerIds.includes(booking.customerId)) {
    return c.json({ error: "Access denied" }, 403);
  }
  await next();
};
