// server/controllers/currencyController.ts
class CurrencyController {
  async getAll(req, res) {
    try {
      const currencies = await currencyService.getAllCurrencies();
      res.json({
        success: true,
        data: currencies
      });
    } catch (error) {
      res.status(400).json({
        success: false,
        error: error.message
      });
    }
  }
  async getActive(req, res) {
    try {
      const currencies = await currencyService.getActiveCurrencies();
      res.json({
        success: true,
        data: currencies
      });
    } catch (error) {
      res.status(400).json({
        success: false,
        error: error.message
      });
    }
  }
  async getByCode(req, res) {
    try {
      const { code } = req.params;
      const currency = await currencyService.getCurrencyByCode(code);
      if (!currency) {
        res.status(404).json({
          success: false,
          error: "Currency not found"
        });
        return;
      }
      res.json({
        success: true,
        data: currency
      });
    } catch (error) {
      res.status(400).json({
        success: false,
        error: error.message
      });
    }
  }
  async updateRates(req, res) {
    try {
      const result2 = await currencyService.updateAllRates();
      res.json({
        success: true,
        data: result2
      });
    } catch (error) {
      res.status(400).json({
        success: false,
        error: error.message
      });
    }
  }
  async updateManualRate(req, res) {
    try {
      const { code } = req.params;
      const { exchangeRateToAED } = req.body;
      if (!exchangeRateToAED || isNaN(exchangeRateToAED)) {
        res.status(400).json({
          success: false,
          error: "Invalid exchange rate"
        });
        return;
      }
      const currency = await currencyService.updateExchangeRate(code, parseFloat(exchangeRateToAED));
      res.json({
        success: true,
        data: currency,
        message: `${code} rate updated successfully`
      });
    } catch (error) {
      res.status(400).json({
        success: false,
        error: error.message
      });
    }
  }
  async convert(req, res) {
    try {
      const { amount, from, to } = req.body;
      if (!amount || !from || !to) {
        res.status(400).json({
          success: false,
          error: "Missing required fields: amount, from, to"
        });
        return;
      }
      const result2 = await currencyService.convertCurrency(parseFloat(amount), from, to);
      res.json({
        success: true,
        data: {
          from,
          to,
          originalAmount: parseFloat(amount),
          convertedAmount: result2
        }
      });
    } catch (error) {
      res.status(400).json({
        success: false,
        error: error.message
      });
    }
  }
  async toggleStatus(req, res) {
    try {
      const { code } = req.params;
      const currency = await currencyService.toggleCurrencyStatus(code);
      res.json({
        success: true,
        data: currency
      });
    } catch (error) {
      res.status(400).json({
        success: false,
        error: error.message
      });
    }
  }
  async initializeDefaults(req, res) {
    try {
      await currencyService.initializeDefaultCurrencies();
      res.json({
        success: true,
        message: "Default currencies initialized"
      });
    } catch (error) {
      res.status(400).json({
        success: false,
        error: error.message
      });
    }
  }
}
