init_prisma();
import { randomUUID as randomUUID7 } from "crypto";

class FileService {
  async createFile(input) {
    const booking = await prisma.bookings.findUnique({
      where: { id: input.bookingId },
      include: {
        customers: true,
        employees_bookings_bookingAgentIdToemployees: true,
        employees_bookings_customerServiceIdToemployees: true
      }
    });
    if (!booking) {
      throw new Error("Booking not found");
    }
    const user = await prisma.users.findUnique({
      where: { id: input.createdById }
    });
    if (!user) {
      const createdUser = await prisma.users.create({
        data: {
          id: input.createdById,
          username: "system_user",
          email: "system@example.com",
          password: "temp_password",
          firstName: "System",
          lastName: "User",
          role: "admin",
          updatedAt: new Date
        }
      });
    }
    const file = await prisma.files.create({
      data: {
        id: randomUUID7(),
        fileNumber: generateFileNumber("FILE", Date.now()),
        bookingId: input.bookingId,
        customerId: booking.customerId,
        status: "pending",
        createdById: input.createdById,
        createdAt: new Date,
        updatedAt: new Date
      }
    });
    const companySettings = await prisma.company_settings.findFirst();
    if (!companySettings) {
      throw new Error("Company settings not found");
    }
    return file;
  }
  async getFileById(id) {
    return await prisma.files.findUnique({
      where: { id },
      include: {
        bookings: {
          include: {
            customers: true
          }
        },
        users: true
      }
    });
  }
  async getFiles(filters) {
    return await prisma.files.findMany({
      where: {
        ...filters.status && { status: filters.status },
        ...filters.customerId && { customerId: filters.customerId },
        ...filters.startDate && filters.endDate && {
          generatedDate: {
            gte: filters.startDate,
            lte: filters.endDate
          }
        }
      },
      include: {
        customers: true,
        bookings: true
      },
      orderBy: {
        generatedDate: "desc"
      }
    });
  }
  async updateFileStatus(id, status2) {
    return await prisma.files.update({
      where: { id },
      data: { status: status2 }
    });
  }
  async deleteFile(id) {
    return await prisma.files.delete({
      where: { id }
    });
  }
}
