async function initialize() {
  try {
    console.log(`
\uD83D\uDE80 Starting Backend Server (Hono + Bun)...`);
    console.log(`\uD83D\uDCE6 Runtime: Bun ${Bun.version}`);
    console.log(`\uD83D\uDCCD Environment: ${"development"}`);
    console.log(`\uD83D\uDD17 Port: ${process.env.PORT || 3001}`);
    console.log("\u23F3 Connecting to database...");
    let retries = 5;
    let connected = false;
    while (retries > 0 && !connected) {
      try {
        await prisma.$connect();
        connected = true;
        console.log("\u2705 Database connected successfully");
      } catch (error) {
        retries--;
        if (retries > 0) {
          console.log(`\u26A0\uFE0F  Database connection failed, retrying... (${retries} attempts left)`);
          await new Promise((resolve) => setTimeout(resolve, 3000));
        } else {
          console.error("\u274C Database connection failed after all retries");
          console.error("\u26A0\uFE0F  Server will run but database operations will fail");
        }
      }
    }
    console.log(`
\u2705 Server initialized successfully`);
    console.log(`\uD83C\uDF10 Health check: http://localhost:${process.env.PORT || 3001}/health`);
    console.log(`\uD83E\uDDEA Test route: http://localhost:${process.env.PORT || 3001}/api/test
`);
  } catch (error) {
    console.error("\u274C Failed to initialize application:", error);
  }
}
